import React from "react";
import logos from "../img/logos.png";


const Main2 = () => (
<div class="main">
본 활동은  프로젝트 활동으로, 비공식 홈페이지 입니다.<br/> 온라인 청년센터(정부)와 관련없습니다. <br/>
 <img class="logos"src={logos} alt="logos"/>
<div class="lnb">
</div>
</div>
)

export default Main2;
